import './App.css';
import Button from 'react-bootstrap/Button';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Form from 'react-bootstrap/Form';
import Panel from 'react-bootstrap/Panel';

function App() {
  return (
    <div className="App">
      <h1>"Main" Artikel</h1>
      <Panel>
        <Panel.Body>

        <Form>
          <Form.Control className='article-input' type="email" placeholder="Enter a word" />
        </Form>
        </Panel.Body>

      </Panel>
    </div>
  );
}

export default App;
